// frontend/src/pages/Login.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      // بيانات اختبارية
      const testUsers = {
        'admin@l3bty.com': { role: 'admin', name: 'المدير العام', branch_name: 'الفرع الرئيسي' },
        'manager1@l3bty.com': { role: 'branch_manager', name: 'أحمد محمد', branch_name: 'غازي مول' },
        'employee1@l3bty.com': { role: 'employee', name: 'محمد أحمد', branch_name: 'غازي مول' }
      };

      // التحقق من بيانات الدخول
      if (password !== '123456') {
        throw new Error('كلمة المرور غير صحيحة');
      }

      const user = testUsers[email];
      if (!user) {
        throw new Error('البريد الإلكتروني غير موجود');
      }

      // حفظ بيانات المستخدم
      localStorage.setItem('token', 'test-token-' + Date.now());
      localStorage.setItem('user', JSON.stringify({ email, ...user }));

      // التوجيه بناءً على الدور
      if (user.role === 'employee') {
        navigate('/employee');
      } else {
        navigate('/admin');
      }

    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <div style={styles.logoContainer}>
          <img 
            src="/images/logol3bty.jpg" 
            alt="L3BTY Logo" 
            style={styles.logo}
          />
          <h2 style={styles.title}>نظام تأجير L3BTY</h2>
          <p style={styles.subtitle}>تسجيل الدخول</p>
        </div>

        {error && (
          <div style={styles.error}>
            {error}
          </div>
        )}

        <form onSubmit={handleLogin} style={styles.form}>
          <div style={styles.formGroup}>
            <label style={styles.label}>البريد الإلكتروني</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              style={styles.input}
              placeholder="ادخل بريدك الإلكتروني"
              required
            />
          </div>

          <div style={styles.formGroup}>
            <label style={styles.label}>كلمة المرور</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              style={styles.input}
              placeholder="ادخل كلمة المرور"
              required
            />
          </div>

          <button 
            type="submit" 
            style={styles.button}
            disabled={loading}
          >
            {loading ? 'جاري التسجيل...' : 'تسجيل الدخول'}
          </button>
        </form>

        <div style={styles.testCredentials}>
          <p style={styles.testTitle}>بيانات الاختبار:</p>
          <div style={styles.credentials}>
            <div><strong>المدير العام:</strong> admin@l3bty.com / 123456</div>
            <div><strong>مدير فرع:</strong> manager1@l3bty.com / 123456</div>
            <div><strong>موظف:</strong> employee1@l3bty.com / 123456</div>
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
    padding: '20px',
  },
  card: {
    background: 'white',
    padding: '2rem',
    borderRadius: '15px',
    boxShadow: '0 20px 60px rgba(0, 0, 0, 0.2)',
    width: '100%',
    maxWidth: '450px',
  },
  logoContainer: {
    textAlign: 'center',
    marginBottom: '2rem',
  },
  logo: {
    height: '80px',
    marginBottom: '1rem',
    borderRadius: '10px',
  },
  title: {
    color: '#333',
    marginBottom: '0.5rem',
  },
  subtitle: {
    color: '#666',
    margin: 0,
  },
  error: {
    background: '#fee',
    color: '#c33',
    padding: '0.75rem',
    borderRadius: '8px',
    marginBottom: '1rem',
    textAlign: 'center',
  },
  form: {
    marginBottom: '1.5rem',
  },
  formGroup: {
    marginBottom: '1rem',
  },
  label: {
    display: 'block',
    marginBottom: '0.5rem',
    color: '#333',
    fontWeight: '500',
  },
  input: {
    width: '100%',
    padding: '0.75rem',
    border: '1px solid #ddd',
    borderRadius: '8px',
    fontSize: '1rem',
    transition: 'border-color 0.3s',
  },
  button: {
    width: '100%',
    padding: '0.75rem',
    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
    color: 'white',
    border: 'none',
    borderRadius: '8px',
    fontSize: '1rem',
    fontWeight: '500',
    cursor: 'pointer',
    transition: 'transform 0.3s',
  },
  testCredentials: {
    marginTop: '1.5rem',
    paddingTop: '1.5rem',
    borderTop: '1px solid #eee',
  },
  testTitle: {
    margin: '0 0 0.5rem 0',
    color: '#666',
    fontWeight: '500',
  },
  credentials: {
    fontSize: '0.875rem',
    color: '#666',
    lineHeight: '1.6',
  },
};

export default Login;
